import React, { useState } from "react";
import "../nav/Navbar.css";
import Logoimg from "../../assets/Udaan_logo2.png";
import { Link } from "react-router-dom";
// import { FiMenu, FiX } from "react-icons/fi";

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const [dropdown, setDropdown] = useState(false);

  return (
    <nav className="navbar-main-container">
      <div className="nav-header">
        <div className="logo-container">
          <img className="logo-img " src={Logoimg} alt="" />
        </div>
        <div className="nav-elements-container ">
          <li>
            <Link className="nav-elements" to="/">
              Home
            </Link>
          </li>
          <li>
            <Link className="nav-elements" to="/about">
              About
            </Link>
          </li>
          <li>
            <Link className="nav-elements" to="/service"  onClick={openDrop}>
              Services
              <select name="" id="">
                <option value="">Admisson </option>
                <option value="">Study Abroad </option>
                <option value="">Sip</option>
                <option value="">Skilled Migraton</option>
              </select>
            </Link>
          </li>
          <li>
            <Link className="nav-elements" to="/contact" >
              Contact
            </Link>
          </li>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
